import React from 'react';

function Analytics() {
    return (
        <div>
            <h2>Performance Analytics</h2>
            <p>Advanced performance analytics, such as win/loss ratios, average hold time, and risk/reward ratios.</p>
        </div>
    );
}

export default Analytics;
